import * as React from "react";
// import { Link } from "@reach/router";
// import * as UTILS from "../src/utils";
// import Axios from "axios";
// import AddArtwork from "./components/AddArtwork";
// import CategorySelector from "./components/CategorySelector";
import { Router } from "@reach/router";
import Design from "./components/Design";
import Home from "./components/Home";
import Illustration from "./components/Illustration";
import IndividualArtwork from "./components/IndividualArtwork";
import Photography from "./components/Photography";
import Painting from "./components/Painting";
import SubNav from "./components/SubNav";
import Menu from "./components/Menu";
import TopNav from "./components/TopNav";
import Account from "./components/Account";
import LandingPage from "./components/LandingPage";

export default class App extends React.Component {

  render() {
    return (
      <React.Fragment>
        <Router>
          <Home path="/" />
          <Design path="/designs" />
          <Illustration path="/illustrations" />
          <Photography path="/photographs" />
          <Painting path="/paintings" />
          <IndividualArtwork path="/IndividualArtwork/:id" />
          <SubNav path="/subnav" />
          <Menu path="/menu" />
          <Account path="/account" />

          <LandingPage path="/landing" />
          <TopNav path="/header" />
        </Router>
        {/* <GlobalNav />  */}

        {/* 
  <AddArtwork /> */}
        {/* <CategorySelector /> */}
      </React.Fragment>
    );
  }
}
